import React from 'react';
import './Nav.css';
import pit from '../img/pit.jpg';
import login_img from '../img/login_img.jpeg';


import { BrowserRouter as Router} from "react-router-dom";

class DonorNav extends React.Component {

    render() {
    return (<Router>
        <div class="home">
            <div class="nav">
            <ul>
                <li><a class="active" href="/"><img alt="sorry" height="120%" width="15%" src={pit}/></a></li>
                <li><a class="links" href="#contact">Contact</a></li>
                <li><a class="links" href="about">About</a></li>
            </ul>
            </div>

        </div>
        </Router>
    );
    }
}
export default DonorNav;
